import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';



const Effect = ()=>{
const [num , SetNum] = useState(0);
const [nums, SetNums] = useState(0);
useEffect(()=>{
    document.title = ``
},)

    return(
        <>
            <button onClick={()=>{
                SetNum(num +1)
            }}>Click Me {num}</button>
            <br />
             <button onClick={()=>{
                SetNums(nums +1)
            }}>Click Me {nums +1}</button>
        </>
    )
}

export default Effect;
